import React, { ReactElement } from "react";
import styled from "styled-components/native";

import { View, H1, Button, Text } from "../../styles";
import { AuthInput, AuthButton } from "./Auth.styles";

interface Props {}

export const LoginDiv = styled(View)`
  flex: 1;
`;

export const LoginTop = styled(View)`
  padding: 30px;
  flex: 1;
`;

export const LoginBottom = styled(View)`
  flex: 2;
  background-color: ${(props: any) => props.theme.text};
  border-top-left-radius: 75px;
  padding: 40px;
`;

export const LoginH1 = styled(H1)`
  font-size: 60;
`;

export const P = styled(Text)`
  opacity: 0.7;
  margin-top: 25px;
  font-size: 22;
`;

export default function Login({}: Props): ReactElement {
  return (
    <LoginDiv>
      <LoginTop>
        <LoginH1>Login</LoginH1>
        <P>Login to your account to access the community</P>
      </LoginTop>
      <LoginBottom>
        <AuthInput placeholder="Username" />
        <AuthInput placeholder="Password" />
        <AuthButton>Submit</AuthButton>
      </LoginBottom>
    </LoginDiv>
  );
}
